    {
      id: "e4",
      title: "Education",
      date: new Date(2023, 9, 18),
      price: 2832,
    },
  ];

  return (
    <div>
      <NewExpense />
      <Expenses expenses={oldExpenses} />
    </div>
  );
}

export default App;
